3	V1	Отклонения от стандартов качества, которые могут вызвать сильное недовольство покупателя и привести к сдаче автомобиля в ремонт.
4	V1+	Отклонения от стандартов качества, которые непосредственно влияют на безопасность, такие как тормозная система, рулевое управление, топливная система, а также могут привести к невозможности эксплуатации автомобиля покупателем или нежеланию его пользовать.
